import React, { useState } from 'react'
import Map from './Map'


function Destination() {
  const [origin, setOrigin] =useState('');
  const [destination, setDestination] =useState('');
  return (

    <div className='row'>
     <div className='col'>
      <input type='text' placeholder='Starting From' onBlur={e =>setOrigin(e.target.value)} />
      <input type='text' placeholder='Going to' onBlur={e =>setDestination(e.target.value)} />
     </div>

     <div className='col'>
     <Map origin={origin} destination={destination}></Map>
     </div>
    </div>
    
  )
}

export default React.memo(Destination)
